css:
.show-todo-preview {
  font-family: "Helvetica Neue", Helvetica, sans-serif;
  font-size: 14px;
  line-height: 1.6;
  background-color: #fff;
  overflow: scroll;
  box-sizing: border-box;
  padding: 20px;
}
.show-todo-preview :not(.editor-colors) > code {
  color: #333;
}
.markdown-spinner {
  margin: auto;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px;
  background-position: top center;
  padding-top: 70px;
  text-align: center;
}
.show-todo-preview .file_url {
  font-size: 10px;
  width: 100px !important;
}
.show-todo-preview .result_table {
  width: 100%;
}
.show-todo-preview .result_heading_title {
  border-bottom: 1px solid #eee;
}
.show-todo-preview .result_heading_title .regex {
  color: #aaa;
  font-size: 14px;
}
.show-todo-preview a {
  color: #4183c4;
}
.show-todo-preview a.absent {
  color: #c00;
}
.show-todo-preview a.anchor {
  display: block;
  padding-left: 30px;
  margin-left: -30px;
  cursor: pointer;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
}
.show-todo-preview h1,
.show-todo-preview h2,
.show-todo-preview h3,
.show-todo-preview h4,
.show-todo-preview h5,
.show-todo-preview h6 {
  font-family: "Helvetica Neue", Helvetica, sans-serif;
  margin: 20px 0 10px;
  padding: 0 0 10px 0;
  font-weight: bold;
  -webkit-font-smoothing: antialiased;
  cursor: text;
  position: relative;
}
.show-todo-preview h1 .octicon-link,
.show-todo-preview h2 .octicon-link,
.show-todo-preview h3 .octicon-link,
.show-todo-preview h4 .octicon-link,
.show-todo-preview h5 .octicon-link,
.show-todo-preview h6 .octicon-link {
  display: none;
  color: #000;
}
.show-todo-preview h1:hover a.anchor,
.show-todo-preview h2:hover a.anchor,
.show-todo-preview h3:hover a.anchor,
.show-todo-preview h4:hover a.anchor,
.show-todo-preview h5:hover a.anchor,
.show-todo-preview h6:hover a.anchor {
  text-decoration: none;
  line-height: 1;
  padding-left: 0;
  margin-left: -22px;
  top: 15%;
}
.show-todo-preview h1:hover a.anchor .octicon-link,
.show-todo-preview h2:hover a.anchor .octicon-link,
.show-todo-preview h3:hover a.anchor .octicon-link,
.show-todo-preview h4:hover a.anchor .octicon-link,
.show-todo-preview h5:hover a.anchor .octicon-link,
.show-todo-preview h6:hover a.anchor .octicon-link {
  display: inline-block;
}
.show-todo-preview h1 tt,
.show-todo-preview h2 tt,
.show-todo-preview h3 tt,
.show-todo-preview h4 tt,
.show-todo-preview h5 tt,
.show-todo-preview h6 tt,
.show-todo-preview h1 code,
.show-todo-preview h2 code,
.show-todo-preview h3 code,
.show-todo-preview h4 code,
.show-todo-preview h5 code,
.show-todo-preview h6 code {
  font-size: inherit;
}
.show-todo-preview table th {
  font-weight: bold;
}
.show-todo-preview table th,
.show-todo-preview table td {
  font-size: 14px;
  padding: 6px 6px;
}
.show-todo-preview table tr {
  background-color: #fff;
}
.show-todo-preview table tr:nth-child(2n) {
  background-color: #f8f8f8;
}
